        <p>نحن متجر إلكتروني متخصص في تقديم أفضل المنتجات بأعلى جودة.</p>
        <p>هدفنا هو تلبية احتياجات العملاء وتوفير تجربة شراء رائعة.</p>
      </div>
    );
  };
  
